import React, { createContext, useContext, useState } from 'react';

const DataContext = createContext();

export const useData = () => {
  return useContext(DataContext);
};

export const DataProvider = ({ children }) => {
  const [employees, setEmployees] = useState([]);
  const [equipment, setEquipment] = useState([
    // Initialize with some default equipment if necessary
    { id_materiel: 1, type_materiel: 'Laptop', marque: 'Dell', modele: 'XPS 13', etat: 'Disponible' },
    { id_materiel: 2, type_materiel: 'Phone', marque: 'Apple', modele: 'iPhone 13', etat: 'Attribué' }
  ]);

  return (
    <DataContext.Provider value={{ employees, setEmployees, equipment, setEquipment }}>
      {children}
    </DataContext.Provider>
  );
};
